import { createStore } from 'redux';

const initialState = {
    jugadores: [
        {
            id: 1,
            name: 'Nahuel Gonzales',
            img: 'data:image/jpeg;base64,'
        },
        {
            id: 2,
            name: 'Ariel Morales',
            img: 'data:image/jpeg;base64,'
        },
        {
            id: 3,
            name: 'Leonel Leither',
            img: 'data:image/jpeg;base64,'
        },
        {
            id: 4,
            name: 'Nahuel Mujica',
            img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjQIXRWp_hXk_CwX7hq1JSd57RhuEiCBwFe5jXYmlrj9eVSWE4Eg'
        },
        {
            id: 5,
            name: 'Jason Ramirez',
            img: 'data:image/jpeg;base64,'
        },
        {
            id: 6,
            name: 'Enzo Morris',
            img: 'data:image/jpeg;base64,'
        },
    ],
    titulares: [],
    suplentes: []
}

const reducerTrainer = (state = initialState, action) => {
    switch (action.type) {
        case 'ADD_TITULAR':
            return {
                ...state,
                titulares: state.titulares.concat(action.jugador),
                jugadores: state.jugadores.filter(j => j.id !== action.jugador.id)
            };
        case 'ADD_SUPLENTE':
            return {
                ...state,
                suplentes: state.suplentes.concat(action.jugador),
                jugadores: state.jugadores.filter(j => j.id !== action.jugador.id)
            };
        case 'PUT_TITULAR':
            return{
                ...state,
                titulares: state.titulares.filter(j=>j.id !== action.jugador.id),
                jugadores: state.jugadores.concat(action.jugador)
            }
        case 'PUT_SUPLENTE':
            return{
                ...state,
                suplentes: state.suplentes.filter(j=>j.id !== action.jugador.id),
                jugadores: state.jugadores.concat(action.jugador)
            }
        default:
            break;
        
    }
    return state
};

export default createStore(reducerTrainer);